.image-accent {
  display: block;
  position: relative;
  font-size: 0;
}
.image-accent::before {
  content: "";
  position: absolute;
  left: -2rem;
  bottom: -1rem;
  height: 100%;
  width: 100%;
  border: 1px solid #eff5f4;
  opacity: 0.3;
  z-index: -1;
}

.glitch {
  position: relative;
}

.glitch::before,
.glitch::after {
  color: white;
  content: attr(data-text);
  position: absolute;
  overflow: hidden;
}

.glitch::before {
  left: -2px;
  text-shadow: -2px 0 red;
  animation-name: glitch-animation-1;
  animation-duration: 2s;
  animation-timing-function: linear;
  animation-delay: 0s;
  animation-iteration-count: infinite;
  animation-direction: reverse-alternate;
}

.glitch::after {
  left: -3px;
  text-shadow: -2px 0 blue;
  animation-name: glitch-animation-2;
  animation-duration: 2s;
  animation-timing-function: linear;
  animation-delay: 0s;
  animation-iteration-count: infinite;
  animation-direction: reverse-alternate;
}

