  position: absolute;
  display: none;
}
.fui-checkbox .checkmark:after {
  left: 9px;
  top: 5px;
  width: 5px;
  height: 10px;
  border: solid #43dbb2;
  border-width: 0 1px 1px 0;
  transform: rotate(45deg);
}

/* Customize the label (the container) */
.fui-radio {
  display: block;
  position: relative;
  padding-left: 35px;
  cursor: pointer;
  user-select: none;
  height: 25px;
  line-height: 1.5;
  /* Hide the browser's default radio button */
  /* On mouse-over, add a grey background color */
  /* When the radio button is checked, add a blue background */
}
.fui-radio input {
  position: absolute;
  opacity: 0;
  cursor: pointer;
  height: 0;
  width: 0;
}
.fui-radio:hover {
  text-decoration: underline;
  font-style: italic;
}
.fui-radio:hover input ~ .checkmark {
  background-color: #1f2e2a;
  border: 1px solid #eff5f4;
}
.fui-radio input:checked ~ .checkmark {
  background-color: #1f2e2a;
  /* Rotate the arcs when checked */
  /* Show the indicator (dot/circle) when checked */
}
.fui-radio input:checked ~ .checkmark:before {
  transform: rotate(0deg);
}
.fui-radio input:checked ~ .checkmark:after {
  transform: scale(1);
}
.fui-radio .checkmark {
  position: absolute;
  top: 0;
  left: 0;
  height: 20px;
  width: 20px;
  background-color: #1a1a1a;
  border: 1px solid rgba(239, 245, 244, 0.5);
  border-radius: 50%;
  /* Create the indicator (the dot/circle - hidden when not checked) */
  /* Style the indicator (dot/circle) */
}
.fui-radio .checkmark:before {
  content: "";
  position: absolute;
  top: -4px;
  left: -4px;
  width: 26px;
  height: 26px;
  border-radius: 50%;
  border-top: 1px solid transparent;
  border-bottom: 1px solid transparent;
  border-left: 1px solid rgba(239, 245, 244, 0.5);
  border-right: 1px solid rgba(239, 245, 244, 0.5);
  transform: rotate(45deg);
  transition: 300ms transform ease-in-out;
}
.fui-radio .checkmark:after {
  content: "";
  position: absolute;
}
.fui-radio .checkmark:after {
  top: 6px;
  left: 6px;
  width: 8px;
  height: 8px;
  border-radius: 50%;
  background: #43dbb2;
  transform: scale(0);
  transition: 300ms 300ms transform ease-in-out;
}

.fui-accordion {
  /* When accordion is open */
}
.fui-accordion label {
  color: #eff5f4;
}
.fui-accordion--head {
  position: relative;
}
.fui-accordion--title {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 0.5rem 0;
  cursor: pointer;
}
.fui-accordion--title:hover .fui-accordion--close {
  color: #43dbb2;
}
.fui-accordion--close {
  user-select: none;
  transform: rotate(-45deg);
  transition: 300ms transform, color ease-in-out;
}
.fui-accordion hr {
  border: 0;
  border-bottom: 1px solid #eff5f4;
  position: absolute;
  top: 0;
  width: 100%;
  height: 100%;
  margin: 0;
  z-index: -1;
  transition: 300ms transform, color ease-in-out;
}
.fui-accordion--content {
  display: none;
}
.fui-accordion.open {
  animation-delay: 300ms;
  animation-fill-mode: both;
  animation-duration: 150ms;
  animation-iteration-count: 2;
  animation-name: flickin;
}
.fui-accordion.open .fui-accordion--close {
  transform: rotate(0);
  color: #ff476f;
}
.fui-accordion.open hr {
  transform: translateY(-100%);
}
.fui-accordion.open .fui-accordion--content {
  display: block;
  padding: 1rem;
}

@keyframes flickin {
  from {
    box-shadow: 0;
  }
  to {
    box-shadow: 0 0 0 1px #eff5f4;
  }
}

