@use 'variables' as *;
@use 'mixins' as mixins;
@use "sass:color";

body {
    color: $secondary;
    background-color: $primary;
    &:after {
        content: '';
        animation: grain 20s steps(10) infinite;
        background-image: url('../assets/img-noise-400x400.png');
        height: 300%;
        left: -50%;
        position: fixed;
        top: -100%;
        width: 300%;
        opacity: 0.5;
        z-index: -1;
    }
}

@keyframes grain {
    0%,
    100% {
        transform: translate(0, 0);
    }
    10% {
        transform: translate(-5%, -10%);
    }
    20% {
        transform: translate(-15%, 5%);
    }
    30% {
        transform: translate(7%, -20px);
    }
    40% {
        transform: translate(-5%, 20px);
    }
    50% {
        transform: translate(-15%, 10%);
    }
    60% {
        transform: translate(15%, 0%);
    }
    70% {
        transform: translate(0%, 15%);
    }
    80% {
        transform: translate(3%, 35%);
    }
    90% {
        transform: translate(-10%, 10%);
    }
}

.dots {
    position: absolute;
    top: 0;
    width: 100%;
    height: 100%;
    background-size: 30px 30px;
    background-image: radial-gradient(
        circle,
        $secondary 1px,
        rgba(0, 0, 0, 0) 1px
    );
}

.bg {
    background-color: rgba(59, 59, 59, 0.3);
}

.lined-corners {
    @include mixins.border-corners($secondary, 1px, 20px);
}

.lined-x-corners {
    @include mixins.border-corners($secondary, 1px, 20px, 1px, 50%);
}

.grid-pattern {
    background-image: linear-gradient(
            transparent 21px,
            rgba(220, 220, 200, 0.8) 22px,
            transparent 22px
        ),
        linear-gradient(
            90deg,
            transparent 21px,
            rgba(220, 220, 200, 0.8) 22px,
            transparent 22px
        );
    background-size: 100% 22px, 22px 100%;
}

.image-accent {
    display: block;
    position: relative;
    font-size: 0;
    &::before {
        content: '';
        position: absolute;
        left: -2rem;
        bottom: -1rem;
        height: 100%;
        width: 100%;
        border: 1px solid $secondary;
        opacity: 0.3;
        z-index: -1;
    }
}

sources.styles\\_mixins.scss:
// mixin for creating bordered
// useage: @include border-corners(color, x, y, ...optional)
// optional arguments are for finer control of x and y values

@mixin border-corners($color, $x, $y, $x1: $x, $y1: $y, $x2: $x, $y2: $y) {
    background-image: linear-gradient($color, $color),
        linear-gradient($color, $color), linear-gradient($color, $color),
        linear-gradient($color, $color), linear-gradient($color, $color),
        linear-gradient($color, $color), linear-gradient($color, $color),
        linear-gradient($color, $color);
    background-repeat: no-repeat;
    background-size: $x1 $y2, $y1 $x2, $x1 $y2, $y1 $x2, $x1 $y2, $y1 $x2,
        $x1 $y2, $y1 $x2, $x1 $y2;
    background-position: left bottom, left bottom, right top, right top,
        left top, left top, right bottom, right bottom;
}

sources.styles\\_effects.scss:
.glitch {
    position: relative;
}

.glitch::before,
.glitch::after {
    color: white;
    content: attr(data-text);
    position: absolute;
    overflow: hidden;
}

.glitch::before {
    left: -2px;
    text-shadow: -2px 0 red;
    animation-name: glitch-animation-1;
    animation-duration: 2s;
    animation-timing-function: linear;
    animation-delay: 0s;
    animation-iteration-count: infinite;
    animation-direction: reverse-alternate;
}

.glitch::after {
    left: -3px;
    text-shadow: -2px 0 blue;
    animation-name: glitch-animation-2;
    animation-duration: 2s;
    animation-timing-function: linear;
    animation-delay: 0s;
    animation-iteration-count: infinite;
    animation-direction: reverse-alternate;
}

@keyframes glitch-animation-1 {
    $steps: 20;
    @for $i from 0 through $steps {
        #{percentage($i*(1/$steps))} {
            clip: rect(random(150) + px, 350px, random(150) + px, 10px);
        }
    }
}

@keyframes glitch-animation-2 {
    $steps: 20;
    @for $i from 0 through $steps {
        #{percentage($i*(1/$steps))} {
            clip: rect(random(150) + px, 350px, random(150) + px, 0px);
        }
    }
}

sources.styles\\_layout.scss:
@use 'variables' as *;

hr {
    color: $secondary;
    border-bottom: 0;
    border-style: solid;
}

//
// Display
//

$display: (
    'block': block,
    'inline-block': inline-block,
    'inline': inline,
    'flex': flex,
    'inline-flex': inline-flex,
    'grid': grid,
    'inline-grid': inline-grid,
    'hidden': none,
) !default;

@each $option, $value in $display {
    .#{$option} {
        display: $value;
    }

    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:#{$option} {
                display: $value;
            }
        }
    }
}

//
// Flexbox
//

$flex-direction: (
    'row': row,
    'row-reverse': row-reverse,
    'col': column,
    'col-reverse': column-reverse,
);

@each $direction, $value in $flex-direction {
    .flex-#{$direction} {
        flex-direction: $value;
    }

    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:flex-#{$direction} {
                flex-direction: $value;
            }
        }
    }
}

$flex-wrap: (
    'wrap': wrap,
    'wrap-reverse': wrap-reverse,
    'no-wrap': nowrap,
);

@each $wrap, $value in $flex-wrap {
    .flex-#{$wrap} {
        flex-wrap: $value;
    }

    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:flex-#{$wrap} {
                flex-wrap: $value;
            }
        }
    }
}

$flex-items: (
    'start': flex-start,
    'end': flex-end,
    'center': center,
    'baseline': baseline,
    'stretch': stretch,
);

@each $alignment, $value in $flex-items {
    .items-#{$alignment} {
        align-items: $value;
    }
    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:items-#{$alignment} {
                align-items: $value;
            }
        }
    }
}

$flex-content: (
    'center': center,
    'start': flex-start,
    'end': flex-end,
    'between': space-between,
    'around': space-around,
);

@each $alignment, $value in $flex-content {
    .content-#{$alignment} {
        align-content: $value;
    }

    .justify-#{$alignment} {
        justify-content: $value;
    }

    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:content-#{$alignment} {
                align-content: $value;
            }
        }
    }

    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:justify-#{$alignment} {
                justify-content: $value;
            }
        }
    }
}

.justify-evenly {
    justify-content: space-evenly;
}

@each $size, $px in $screens {
    @media screen and (min-width: $px) {
        .#{$size}\:justify-evenly {
            justify-content: space-evenly;
        }
    }
}

$flex: (
    '1': 1 1 0%,
    'auto': 1 1 auto,
    'initial': 0 1 auto,
    'none': none,
);

@each $item, $value in $flex {
    .flex-#{$item} {
        flex: $value;
    }

    @each $size, $px in $screens {
        @media screen and (min-width: $px) {
            .#{$size}\:flex-#{$item} {
                flex: $value;
            }
        }
    }
}

