@use 'variables' as *;

ul {
    margin: 0;
    padding: 0;
    list-style: none;
}

ul.lined {
    li {
        padding-top: 1rem;
        padding-bottom: 1rem;
        border-bottom: 1px solid $secondary;
        &:first-child {
            padding-top: 0;
        }
    }
}

ul.spaced {
    li {
        padding-bottom: 1rem;
        &:last-child {
            padding-bottom: 0;
        }
    }
}

ul.zebra {
    li {
        padding: 0.5rem;
        &:nth-child(even) {
            background-color: $accent-dark;
        }
    }
}

ul.hover-highlight {
    li {
        &:focus,
        &:hover {
            border-left: 0.25rem solid $accent;
            padding-left: 0.75rem;
        }
    }
}

sources.styles\\_buttons.scss:
@use 'variables' as *;
@use "sass:color";

.btn {
    padding: 0.5em 1em;
    text-decoration: none;
    font-weight: 600;
    border: 0;
    display: inline-block;
    cursor: pointer;
    font-family: Office Code Pro;
    text-transform: uppercase;

    &--bw {
        color: $secondary;
        background-color: transparent;
        position: relative;
        line-height: 1;
        border: 1px solid color.adjust($secondary, $alpha: -0.8);
        &:after {
            content: '';
            // background-color: color.adjust($secondary, $alpha: -0.9);
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            width: 90%;
            height: 70%;
        }
        &:hover {
            border: 1px solid $secondary;
            transform: translate(-1px, -1px);
            &:after {
                box-shadow: -1px 1px 1px $accent;
            }
        }
        &:active {
            transform: translate(0, 0);
        }
    }

    &--accent {
        background-color: $accent;
        color: $primary;
        position: relative;
        &:hover {
            transform: translate(-1px, -1px);
            box-shadow: inset 0 0 0 1px $secondary;
            color: $secondary;
            background-color: transparent;
        }
        &:active {
            transform: translate(0, 0);
        }
    }
}

sources.styles\\_forms.scss:
@use 'variables' as *;
@use 'mixins' as mixins;
@use "sass:color";

label {
    font-family: $font-mono;
    color: $accent;
    text-transform: uppercase;
}

input {
    color: $secondary;
}

input[type='text'] {
    border: 0;
    margin: 0.75rem 0;
    padding: 5px 7px;
    font-family: $font-mono;
    background-color: $accent-dark;
    @include mixins.border-corners(transparentize($secondary, 0.5), 1px, 5px);
    // border: 5px inset $primary;
    // outline: 1px solid transparentize($secondary, 0.5);
}

// ----------------
// CHECKBOX
// ----------------

/* Customize the label (the checkbox) */
.fui-checkbox {
    display: block;
    position: relative;
    padding-left: 35px;
    cursor: pointer;
    user-select: none;
    height: 25px;
    line-height: 1.5;

    /* Hide the browser's default checkbox */
    input {
        position: absolute;
        opacity: 0;
        cursor: pointer;
        height: 0;
        width: 0;
    }

    /* On mouse-over */
    &:hover {
        text-decoration: underline;
        font-style: italic;
        input ~ .checkmark {
            @include mixins.border-corners($secondary, 0.5, 1px, 5px);
        }
    }

    /* When the checkbox is checked */
    input:checked ~ .checkmark {
        background-color: $primary-100;
    }

    /* Show the checkmark when checked */
    input:checked ~ .checkmark:after {
        display: block;
    }

    /* Create a custom checkbox */
    .checkmark {
        position: absolute;
        top: 0;
        left: 0;
        height: 25px;
        width: 25px;
        background-color: $accent-dark;
        @include mixins.border-corners(
            transparentize($secondary, 0.5),
            1px,
            5px
        );

        /* Create the checkmark/indicator (hidden when not checked) */
        &:after {
            content: '';
            position: absolute;
            display: none;
        }

        /* Style the checkmark/indicator */
        &:after {
            left: 9px;
            top: 5px;
            width: 5px;
            height: 10px;
            border: solid $accent;
            border-width: 0 1px 1px 0;
            transform: rotate(45deg);
        }
    }
}
// ----------------
// END CHECKBOX
// ----------------

// ----------------
// RADIO BUTTON
// ----------------

/* Customize the label (the container) */
.fui-radio {
    display: block;
    position: relative;
    padding-left: 35px;
    cursor: pointer;
    user-select: none;
    height: 25px;
    line-height: 1.5;

    /* Hide the browser's default radio button */
    input {
        position: absolute;
        opacity: 0;
        cursor: pointer;
        height: 0;
        width: 0;
    }

    &:hover {
        text-decoration: underline;
        font-style: italic;
    }

    /* On mouse-over, add a grey background color */
    &:hover input ~ .checkmark {
        background-color: $accent-dark;
        border: 1px solid $secondary;
    }

    /* When the radio button is checked, add a blue background */
    input:checked ~ .checkmark {
        background-color: $accent-dark;

        /* Rotate the arcs when checked */
        &:before {
            transform: rotate(0deg);
        }

        /* Show the indicator (dot/circle) when checked */
        &:after {
            transform: scale(1);
        }
    }

    .checkmark {
        position: absolute;
        top: 0;
        left: 0;
        height: 20px;
        width: 20px;
        background-color: $primary;
        border: 1px solid transparentize($secondary, 0.5);
        border-radius: 50%;

        &:before {
            content: '';
            position: absolute;
            top: -4px;
            left: -4px;
            width: 26px;
            height: 26px;
            border-radius: 50%;
            border-top: 1px solid transparent;
            border-bottom: 1px solid transparent;
            border-left: 1px solid transparentize($secondary, 0.5);
            border-right: 1px solid transparentize($secondary, 0.5);
            transform: rotate(45deg);
            transition: 300ms transform ease-in-out;
        }

        /* Create the indicator (the dot/circle - hidden when not checked) */
        &:after {
            content: '';
            position: absolute;
        }

        /* Style the indicator (dot/circle) */
        &:after {
            top: 6px;
            left: 6px;
            width: 8px;
            height: 8px;
            border-radius: 50%;
            background: $accent;
            transform: scale(0);
            transition: 300ms 300ms transform ease-in-out;
        }
    }
}
// ----------------
// END RADIO BUTTON
// ----------------

sources.styles\\_accordions.scss:
@use 'variables' as *;
@use 'mixins' as mixins;
@use "sass:color";

.fui-accordion {
    label {
        color: $secondary;
    }

    &--head {
        position: relative;
    }

    &--title {
        display: flex;
        justify-content: space-between;
        align-items: center;
        padding: 0.5rem 0;
        cursor: pointer;

        &:hover {
            .fui-accordion--close {
                color: $accent;
            }
        }
    }

    &--close {
        user-select: none;
        transform: rotate(-45deg);
        transition: 300ms transform, color ease-in-out;
    }

    hr {
        border: 0;
        border-bottom: 1px solid $secondary;
        position: absolute;
        top: 0;
        width: 100%;
        height: 100%;
        margin: 0;
        z-index: -1;
        transition: 300ms transform, color ease-in-out;
    }

    &--content {
        display: none;
    }

    /* When accordion is open */
    &.open {
        animation-delay: 300ms;
        animation-fill-mode: both;
        animation-duration: 150ms;
        animation-iteration-count: 2;
        animation-name: flickin;

        .fui-accordion--close {
            transform: rotate(0);
            color: $danger;
        }

        hr {
            transform: translateY(-100%);
        }

        .fui-accordion--content {
            display: block;
            padding: 1rem;
        }
    }
}

@keyframes flickin {
    from {
        box-shadow: 0;
    }

    to {
        box-shadow: 0 0 0 1px $secondary;
    }
}
